import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MyComponent = () => {
    const [message, setMessage] = useState('');

    useEffect(() => {
        axios.get('/api/data/')
            .then(response => {
                setMessage(response.data.message);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, []);

    return (
        <div>
            <h1>{message}</h1>
        </div>
    );
};

export default MyComponent;
